import { HashRouter } from "react-router-dom";
import Navbar from "./Navbar";
import Pages from "../pages/Pages";
import Footer from "./Footer";

import "../css/App.css";

function App() {
  return (
    <HashRouter>
      <div className="App">
        <header>
          <Navbar />
        </header>
        <main>
          <Pages />
        </main>
        <footer>
          <Footer />
        </footer>
      </div>
    </HashRouter>
  );
}

export default App;
